import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import MonthlyView from './pages/MonthlyView';
import BillsManagement from './pages/BillsManagement';
import CreditCardsLoans from './pages/CreditCardsLoans';
import BudgetCategories from './pages/BudgetCategories';
import FutureExpenses from './pages/FutureExpenses';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <nav className="navbar">
          <div className="nav-container">
            <h1 className="nav-title">ðŸ’° Budget App</h1>
            <div className="nav-links">
              <Link to="/" className="nav-link">Dashboard</Link>
              <Link to="/monthly" className="nav-link">Monthly View</Link>
              <Link to="/bills" className="nav-link">Bills</Link>
              <Link to="/debt" className="nav-link">Debt</Link>
              <Link to="/budget" className="nav-link">Budget</Link>
              <Link to="/goals" className="nav-link">Goals</Link>
            </div>
          </div>
        </nav>

        <main className="main-content">
          <Routes>
            <Route path="/" element={<Dashboard />} />
            <Route path="/monthly" element={<MonthlyView />} />
            <Route path="/bills" element={<BillsManagement />} />
            <Route path="/debt" element={<CreditCardsLoans />} />
            <Route path="/budget" element={<BudgetCategories />} />
            <Route path="/goals" element={<FutureExpenses />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
